
import pyexcel_ods as pe
import re


def skip_comments(f):
    '''
    Read lines that DO NOT start with a # symbol.
    '''
    for line in f:
        if not line.strip().startswith('#'):
            yield line


def get_asteca_data():
    '''
    Read the ASteCA output data file 'asteca_output.dat' and store each
    data column for each cluster.
    '''

    # Path to data file.
    out_file = 'asteca_output_final.dat'

    # Read data file
    with open(out_file) as f:
        as_names, as_pars = [], []

        for line in skip_comments(f):
            as_names.append(line.split()[0])
            # Read clusters parameters obtained by ASteCA.
            as_pars.append(line.split()[1:])

    return as_names, as_pars


def get_massclean_data():
    '''
    Read the ASteCA output data file 'asteca_output.dat' for the synthetic
    clusters generated with MASSCLEAN.
    '''

    # Path to data file.
    mc_files = ['OCs_data/asteca_output_massclean_smc.dat',
                'OCs_data/asteca_output_massclean_lmc.dat']

    # Read data files
    mc_data, mc_pars = [[], []], [[], []]
    for i, mc_f in enumerate(mc_files):
        with open(mc_f) as f:
            for line in skip_comments(f):
                # Store Real age, met, and total mass
                # Separate mass, age and metallicity.
                delimiters = "/", "_"
                regexPattern = '|'.join(map(re.escape, delimiters))
                mma = re.split(regexPattern, line.split()[0])
                mass = float(mma[0]) * 1000. if mma[0] != '0005' else 500.
                met = float('0.' + mma[2][1:])
                age = float(mma[3]) * 0.01
                mc_data[i].append([met, age, mass])
                # Read clusters parameters obtained by ASteCA.
                mc_pars[i].append(line.split()[1:])

    massclean_data_pars = [mc_data, mc_pars]
    return massclean_data_pars


def get_bica_database():
    '''
    Read Bica et el. (2008) database.
    '''
    # Path to data file.
    bb_file = 'databases/bb_cat.dat'

    # Read data file
    with open(bb_file) as f:
        bica_database = []
        for line in skip_comments(f):
            # Read coordinates.
            bica_database.append([float(_) for _ in line.split()])

    return bica_database


def get_amr_lit():
    '''
    Read AMR literature data.
    '''
    # Path to data Pagel & T (1998) file.
    in_file = 'AMRs/PT98_s-lmc_amr.dat'
    # Read data file
    with open(in_file) as f:
        # i=0 --> SMC ; i=1 --> LMC
        amr_PT98_t = [[], []]
        for line in skip_comments(f):
            ls = line.split()
            # Read coordinates.
            if ls[2] != '--':
                amr_PT98_t[0].append([float(_) for _ in [ls[2], ls[3]]])
            amr_PT98_t[1].append([float(_) for _ in [ls[0], ls[1]]])

    # Put SMC values first and LMC second.
    amr_smc_PT98, amr_lmc_PT98 = zip(*amr_PT98_t[0]), zip(*amr_PT98_t[1])

    # Path to data G98 file.
    in_file = 'AMRs/G98_lmc_amr.dat'
    # Read data file
    with open(in_file) as f:
        amr_lmc_G98 = [[], []]
        for line in skip_comments(f):
            ls = line.split()
            # Read coordinates.
            amr_lmc_G98[0].append(float(ls[0]))
            amr_lmc_G98[1].append(float(ls[1]))

    # Path to data C08 file.
    in_file = 'AMRs/C08_lmc_amr.dat'
    # Read data file
