        amr_lmc_HZ09 = [[], []]
        for line in skip_comments(f):
            ls = line.split()
            # Read coordinates.
            amr_lmc_HZ09[0].append(float(ls[0]))
            amr_lmc_HZ09[1].append(float(ls[1]))

